import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'

const panaseer = {
  'image':require("./../content/projects/panaseer/9.png"),
  'image':require("./../content/projects/panaseer/8.png")
}

const joyStory = {
  'image':require("./../content/projects/joyStory/thumbnail.png"),
  'image2':require("./../content/projects/joyStory/thumbnail-colour.png")
}

const beatbox = {
  'image':require("./../content/projects/beatbox/thumbnail.jpg")
}

const project_total = "03"

function Home(props) {
  return (
    <div>
      <HomepageProject
       projectKey={'panaseer'}
       image={panaseer.image}
       number="01"
       total={project_total}
      />
      <HomepageProject
       projectKey={'joyStory'}
       image={joyStory.image}
       number="02"
       total={project_total}
      />
      <HomepageProject
       projectKey={'beatbox'}
       image={beatbox.image}
       number="03"
       total={project_total}
      />
      <div className='all-projects'>
        <Link to="/projects" className="strikeNav">All Projects</Link>
      </div>

    </div>
  );
}

export default Home;
